Praise Yahweh, for he is good;
\q sing praises to his name, for it is pleasant to do so.
\q

13:
Your name, Yahweh, endures forever;
\q your renown, Yahweh, endures throughout all generations.
\q

16:
Those idols have mouths, but they do not speak;
\q they have eyes, but they do not see;
\q

19:
Descendants of Israel, bless Yahweh;
\q descendants of Aaron, bless Yahweh.
\q

20:
Descendants of Levi, bless Yahweh;
\q you who honor Yahweh, bless Yahweh.
\q
